import React from 'react'

function Navbar() {
  return (
    <>
        <div className="">
            <h1>Homegate</h1>
            <div className="nav-links">
                <a href="/">Home</a>
                <a href="/login">Login</a>
                <a href="/signup">Sign Up</a>
            </div>
        </div>
    </>
  )
}

export default Navbar;
